/*
680. Valid Palindrome II

Given a non-empty string s, you may delete at most one character. Judge whether you can make it a palindrome.

Example 1:
Input: "aba"
Output: True
Example 2:
Input: "abca"
Output: True
Explanation: You could delete the character 'c'.
Note:
The string will only contain lowercase characters a-z. The maximum length of the string is 50000.
*/
public class ValidPalindromeII{
    public static void main(String[]args){
        Solution solution = new Solution();
        String[] input = {
            "aba", "abca","abcda", "cdadc","cdaedc","cdaecdc","","",""
        };
        for(String s : input)
            System.out.println(solution.validPalindrome(s));
    }
}
class Solution {
    public boolean validPalindrome(String s) {
        return RecursionHelper(s,false);
    }
    private boolean RecursionHelper(String s, boolean isRemoved){
        if(s.length() < 2)
            return true;
        int left = 0, right = s.length()- 1;
        while(s.charAt(left) == s.charAt(right)){
            left++; right--;
            if(right - left < 2)
                return true;
        }
        s = s.substring(left, right+1);
        if(isRemoved == false){
            if(RecursionHelper(s.substring(1),true))
                return true;
            if(RecursionHelper(s.substring(0, s.length()-1),true))
                return true;
        }
        return false;
    }
}
